AR-15 Surplus Arms and Ammo L15 in 5.56 1/9 carbine which includes:
14.5" Government Profile M4A1 Receiver w/ pinned and welded Yankee Hill Machine Phatom flash hider;
Unfired SAA lower - Both bought as rifle kit + lower;
Magpul ACS stock in FDE;
Magpul Buis gen 2 in FDE;
Magpul mid-length MOE handguard in FDE;
Magpul pistol grip in FDE;
Magpul MOE trigger guard in FDE;
Magpul MS3 QD single & two point system uhhh..in FDE;
Troy dual QD sling mount.

The carbine comes with 1 FDE pmag 20 rounder. This is ready to go, new 14.5" pinned carbine. Price is OBO. The ad stays up if it's still available.

TERMS: No felons, No minors, No abusive spouse and so on as per CO law. By contacting me you are legal to own a long gun. I will ask you to show me your Colorado ID/DL or CCW. No need for Bill of Sale or taxes as this will be a private face to face sale in Denver Metro area. 
Price: $1800 FIRM. 
If you are an LE/VET/active duty military w/ proper ID, I will sell this carbine for $1700.

Keyword: SAA, Surplus Arms & Ammo, not armalite, dpms, colt, noveske, barrett, pof 415, delton, bushmaster, 6920, sig m400, s&w mp15, stag, spikes, bravo arms.
